import React from 'react'
import {
  BrowserRouter,
  Routes,
  Route
} from 'react-router-dom'
import Header from '../components/Header'

import routes from '../router'

const App = () => {
  return(
    <>
      <Header />
      <BrowserRouter>
        <Routes>
          {
            routes.map( (route, index) => (
              <Route 
                key={index}
                path={route.path}
                element={<route.component/>}
              />
            ) )
          }
        </Routes>
      </BrowserRouter>
    </>
  )
}

export default App
